                              {" "}
                              <span
                                className={`badge badge-${handleBookingStatusColor(
                                  item.bookingStatus
                                )}`}
                              >
                                {item.bookingStatus}
                              </span>
                            </td>
                            <td>{new Date(item.createdDate).toUTCString()}</td>
                            <td>{new Date(item.updatedDate).toUTCString()}</td>
                          </tr>
                        ))}
                      </tbody>

                      <tfoot>
                        <tr>
                          {bookingsData.length >= 10 && (
                            <td>
                              <button
                                className="page-link"
                                onClick={() => handlePageNo(1)}
                              >
                                Next
                              </button>
                            </td>
                          )}
                          {pageNo >= 1 && (
                            <td>
                              <button
                                className="page-link"
                                onClick={() => handlePageNo(-1)}
                              >
                                Back
                              </button>
                            </td>
                          )}
                        </tr>
                      </tfoot>
                    </table>
                  </div> */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Bookings;
